import "./App.css";
import React from "react";
import Navbar from "./Components/Navbar";
import Bgi from "./Components/bgi";
import Skill from "./Components/skill.js";
import { skilldata } from "./Components/skilldata";
import Aboutme from "./Components/Aboutme";
import Projects from "./Components/projects";
import Footer from "./Components/footer";
import {
  createBrowserRouter,
  createRoutesFromElements,
  Route,
  Link,
  Outlet,
  RouterProvider,
} from "react-router-dom";

export default function App() {
  const router = createBrowserRouter(
    createRoutesFromElements(
      <Route path="/" element={<Root />}>
        <Route index element={<Bgi />} />
        <Route path="./Components/Aboutme" index={<Aboutme />} />
        <Route index={<Skill slides={skilldata} />} />
        <Route index={<Projects />} />
        <Route index={<Footer />} />
      </Route>
    )
  );

  return (
    <>
      <Navbar />

      <Bgi />
      <Aboutme />
      <Skill slides={skilldata} />
      <Projects />
      <Footer />
      <RouterProvider router={router} />
    </>
  );
}

const Root = () => {
  return (
    <>
      <Navbar />
      <div>
        <Outlet />
      </div>
    </>
  );
};
